import React, { Component } from "react";
import NavBar from "./components/navbar";
import Gainers from "./components/gainers";
import { BrowserRouter } from "react-router-dom";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <BrowserRouter>
        <React.Fragment>
          <NavBar />
          <div>
            <Gainers />
          </div>
        </React.Fragment>
      </BrowserRouter>
    );
  }
}

export default App;
